import React from 'react'
import product from '../product'
import {Row, Col} from "react-bootstrap"

const HomeScreen = () =>
{
    return(
        <>
        <h1> Latest products</h1>
        <Row>
                {product.map(products => 
            (
                <Col sm={12} md={6} lg={4} xl={3}>
                    <Product product={product} />
                    </Col>
            ))}
        </Row>
        </>
    
    )
} 


export default HomeScreen
